  return (
    <p>{props.module} - {props.exercises}</p>
  )
}

const Total = (props) => {
  return (
    <p>Number of exercises: {props.total}</p>
  )
}

const Content = (props) => {
  return (
    <Part module={props.parts[0].part} exercises={props.parts[0].exercises} />
